import { Link as RouterLink, useNavigate } from 'react-router-dom';
import React, { useRef, useLayoutEffect, useState } from "react";
import Col from 'react-bootstrap/Col';
import Form from 'react-bootstrap/Form';
import Row from 'react-bootstrap/Row';
import { ScrollMenu, VisibilityContext } from 'react-horizontal-scrolling-menu';
import map from "lodash/map";
import range from "lodash/range";
import {ScrollBox, ScrollAxes, FastTrack} from 'react-scroll-box';


const Account = (props) => {
    const items=['Item 1','Item 2','Item 3','Item 4'];
    //const [items] = React.useState(getItems);
    //const scenes = ['scene1','s2','s3','s4']
    const [sentences, setSentences] = useState(['s1','s2','s3','s4'])
    const [chars, setChars] = useState([['s1char1','s1char2'], ['s2char1', 's2c2'], ['s3'], ['s4']]);
    const [scenes, setScenes] = useState(['scene1','s2','s3','s4']);
    const [acts, setActs] = useState([['s1act1','s1act2'], ['s2act1', 's2act2'], ['s3'], ['s4']]);

    const sceneStates = [];
    for (let i=0;i<4;i++) {
    }

    //const navigate = useNavigate();
    const handleSubmit = (e) => {
        e.preventDefault();
        alert('output'+e);
    }
    function handleScenes(e, itemId) {
        const newScenes = scenes.map((s,i) => {if(i===itemId){return e;}else{return s;}});
        setScenes(newScenes);
    }
    function handleChars(e, itemId, charId) {
        const newChars = [];
        for (let i=0;i<items.length;i++) {
            if (i === itemId) newChars.push( chars[i].map((s,i) => {if(i===charId){return e;}else{return s;}}));
            else newChars.push( chars[i].map((s,i) => {return s;}));
        }
        setChars(newChars);
    }
    function handleActs(e, itemId, charId) {
        const newActs = [];
        for (let i=0;i<items.length;i++) {
            if (i === itemId) newActs.push( acts[i].map((s,i) => {if(i===charId){return e;}else{return s;}}));
            else newActs.push( acts[i].map((s,i) => {return s;}));
        }
        setActs(newActs);
    }

    const DreamCard = ({itemId}) => {
        //alert('id:'+id.target);
        //const itemId = '0';

        return (
            <div>
                <form className='dream-file' style={{minHeight:'60px'}}>
                    <text className='input-title' style={{textAlign:'left'}}>Dream Title{itemId}</text>
                    <text className='input-text' style={{textAlign:'left'}}>Dream description...</text>
                </form>
            </div>
        );
    }

    const CharCard = ({itemId, charId}) => {
        return (
            <div class='row'>
                <div class='column' style={{width:'30%'}}>
                <input className='input-box' value={chars[itemId][charId]} style={{width:'300px'}} onChange={(e) => handleChars(e.target.value, itemId, charId)} type='text' placeholder='' id='char' name='char' />
                </div>
                <div class='column' style={{width:'70%'}}>
                <input className='input-box' value={acts[itemId][charId]} style={{marginLeft:'60px', width:'630px'}} onChange={(e) => handleActs(e.target.value, itemId, charId)} type='text' placeholder='' id='act' name='act' />
                </div>
            </div>
        )
    }

    return (
        <div>
            <div className='column' style={{width:'40%', textAlign:'left', transform:'translate(-50%, 0)'}} onSubmit={handleSubmit}>
                <div className='header' style={{position:'fixed', width:'1100px'}} >
                    <label className='h3-light'>Want to have a new dream journey?</label>
                    <button className='button-light' style={{position: 'relative', left: '70px', top: '120px'}}>Start</button>
                </div>

                <div class='inte-form' style={{height:'500px', width:'500px', marginTop:'50%', marginBottom:'100px', overflow:'scroll'}}>
                    {items.map((item, index) => (
                        <div>{DreamCard( {itemId:index}) }</div>
                    ))}
                </div>
            </div>

            <div  className='column' style={{width:'40%', textAlign:'left', transform:'translate(-50%, 0)'}} onSubmit={handleSubmit}>
            <div class='inte-form' style={{height:'700px', width:'500px', marginTop:'10%', marginBottom:'100px', overflow:'scroll'}}>
                {items.map((item, index) => (
                    <div>{DreamCard( {itemId:index}) }</div>
                ))}
            </div>
            </div>
        </div>
    );
};

export default Account;
